import React from "react";
import "./Card.css"
export const CardProducto = () => {
    return (
        <div>
            <h1 className="card-nombre">NOMBRE PRODUCTO</h1>
            <p className="card-nombreSupermercado">Supermercado: </p>
            <p className="card-categoria">Categoria: </p>
            <p className="card-precio">Precio: </p>
            <a href="google.com" className="card-btn">GODEL</a>
        </div>
    );
};
